import React from "react";
import Column from "./Column";
import "./dnd.css";

const ColumnList = () => {
  const liEnterHandler = e => {
    console.log(e.target.tagName);
    if (e.target.tagName !== "LI") {
      return;
    } else {
      e.target.className = "taskItem active";
    }
  };

  return (
    <div className="column-container" style={{ display: "flex" }}>
      <div className="column1">
        <ul style={{ listStyleType: "none" }}>
          <li>
            <span>task1</span>
          </li>
          <li>
            <span></span>
          </li>
          <li>
            <span></span>
          </li>
        </ul>
      </div>
      <div className="column2">
        <ul style={{ listStyleType: "none" }}>
          <li onMouseEnter={liEnterHandler}>
            <span>task1</span>
          </li>
          <li>
            <span></span>
          </li>
          <li>
            <span></span>
          </li>
        </ul>
      </div>
      <div className="column3">
        <ul style={{ listStyleType: "none" }}>
          <li>
            <span>task1</span>
          </li>
          <li>
            <span></span>
          </li>
          <li>
            <span></span>
          </li>
        </ul>
      </div>
    </div>
  );
};

export default ColumnList;
